WOMT_aTexte['popup_faq_1_frage']=new Array();
WOMT_aTexte['popup_faq_1_frage'][0]='Nach welchen Kriterien werden die Parteien für den Wahl-O-Mat ausgesucht?';
WOMT_aTexte['popup_faq_1_text']=new Array();
WOMT_aTexte['popup_faq_1_text'][0]='Die Bundeszentrale für politische Bildung/bpb hat alle Parteien und politischen Vereinigungen, die vom der Landeswahlleiterin in Nordrhein-Westfalen zur Landtagswahl 2010 zugelassen wurden, zur Teilnahme am Wahl-O-Mat eingeladen. Eine informative Übersicht aller zugelassenen Parteien finden Sie auf <a tabindex="16" title="Wer steht zur Wahl? (Dieser Link öffnet sich in einem neuen Fenster.)" class="link_normal" href="http://www.werstehtzurwahl.de" target="_blank">www.werstehtzurwahl.de</a>.<br/><br/>Alle 25 zugelassenen Parteien haben die Thesen bis zum Redaktionsschluss am 26. März 2010 beantwortet. Grundsätzlich gilt als Kriterium, dass alle Parteien und politischen Vereinigungen am Wahl-O-Mat teilnehmen dürfen, die von der Landeswahlleiterin zugelassen werden. Es werden also keine Einzelkandidaten und sonstige politischen Vereinigungen aufgenommen, die nur in einem oder wenigen Wahlkreisen antreten. Somit können aber auch Parteien im Wahl-O-Mat auftauchen, die vom Verfassungsschutz des Bundes oder der Länder beobachten werden und als "extremistisch" eingestuft werden. Welche Parteien als extremistisch eingestuft werden, können Sie auf den Seiten des Verfassungsschutzes nachlesen: <a tabindex="17" title="Verfassungsschutzbericht NRW 2009 (Dieser Link öffnet sich in einem neuen Fenster.)" class="link_normal" href="http://www.im.nrw.de/sch/29.htm" target="_blank">Verfassungsschutzbericht NRW 2009</a>. Zusätzlich kommt die bpb dem Informationsbedürfnis über alle zur Wahl zugelassenen Parteien und Wählervereinigungen auch weiterhin durch das Online-Angebot <a tabindex="18" title="Wer steht zur Wahl? (Dieser Link öffnet sich in einem neuen Fenster.)" class="link_normal" href="http://www.werstehtzurwahl.de" target="_blank">"Wer steht zur Wahl?"</a> nach.';
WOMT_aTexte['xxx_dummy9']=new Array();
WOMT_aTexte['xxx_dummy9'][0]=' ';
WOMT_aTexte['popup_faq_9_text']=new Array();
WOMT_aTexte['popup_faq_9_text'][0]='Der Wahl-O-Mat ist ein Angebot zur politischen Bildung und Information - und keine Wahlempfehlung. Er möchte zum einen wichtige Fragen der Landtagswahl vorstellen und zum anderen die Auseinandersetzung des Users mit den zur Wahl zugelassenen Parteien unterstützen. Daher liegt in der Handhabung der Fokus auf der inhaltlichen Auseinandersetzung mit den einzelnen Thesen sowie mit den Parteien und deren Positionen. <br/><br/>Dazu gehört auch, dass die User zunächst eigenverantwortlich eine Entscheidung darüber treffen, welche Parteien für sie von Interesse sind und sie zur Berechnung des Vergleichs auswählen wollen.<br/><br/>Sie können bis zu acht Parteien gleichzeitig auswählen, mit denen Sie Ihre eigene Positionen vergleichen möchten. Die Reihenfolge der Parteien auf dieser Wahl-O-Mat-Seite richtet sich nach der Reihenfolge auf dem Stimmzettel. Keine der Parteien wurde im Wahl-O-Mat vorab ausgewählt. Die Auswahl obliegt allein dem User.<br/><br/>Der Wahl-O-Mat richtet sich zudem insbesondere an Politik-Neulinge und Erst- und Jungwähler. Hier ist es besonders wichtig, zum einen die eigenständige und bewusste Auseinandersetzung zu fördern, zum anderen aber auch die Ergebnisse möglichst übersichtlich, klar strukturiert und leicht verständlich darzustellen. Dieses Ziel lässt sich mit einer selbst gewählten und immer wieder neu auszuwählenden begrenzten Anzeige der Parteien besser erreichen, als ein Wahl-O-Mat Ergebnis aller Einzelvoten im Vergleich mit allen 25 Parteien zu jeweils 38 Thesen.<br/><br/>Damit Sie sich einen Überblick über alle 25 Parteien verschaffen können, hat die bpb zusätzlich auf der Parteien-Auswahl-Seite im Wahl-O-Mat hinter jeder Partei ein Parteienprofil des bpb-Angebots "Wer steht zur Wahl" (<a tabindex="56" title="Wer steht zur Wahl? (Dieser Link öffnet sich in einem neuen Fenster.)" class="link_normal" href="http://www.werstehtzurwahl.de" target="_blank">www.werstehtzurwahl.de</a>) verlinkt. So können Sie sich kurze Informationen über alle zur Wahl zugelassenen 25 Parteien einholen und besonders über viele der kleineren Parteien mehr erfahren.<br/><br/>Dennoch können Sie Ihre Position mit allen 25 Parteien im Wahl-O-Mat vergleichen:<br/><br/>- Wählen Sie einfach unter der ersten Auswertung den Link zur "Zurück zur Parteienauswahl" und wählen Sie erneut acht Parteien aus - ohne dabei alle 38 Thesen neu beantworten zu müssen.<br/><br/>- Oder vergleichen Sie Ihre Position mit allen 25 Parteien auf einer Übersicht aller 25 Parteiantworten als PDF auf der Seite "Ihr Wahl-O-Mat Ergebnis".';
WOMT_aTexte['popup_faq_2_frage']=new Array();
WOMT_aTexte['popup_faq_2_frage'][0]='Wie ist der Wahl-O-Mat entwickelt worden? Sind die Parteien und Wählervereinigungen daran beteiligt gewesen?';
WOMT_aTexte['popup_faq_2_text']=new Array();
WOMT_aTexte['popup_faq_2_text'][0]='Der Wahl-O-Mat ist in Deutschland erstmals zur Bundestagswahl 2002 eingesetzt worden. Er wurde von einer unabhängigen Redaktion, die aus jungen Erwachsenen besteht, in Kooperation mit der Bundeszentrale für politische Bildung/bpb und mit Unterstützung ihrer Partner und des niederländischen Instituut voor Publiek en Politiek (Institut für Öffentlichkeit und Politik - IPP) entwickelt. Dabei ging der Wahl-O-Mat aus dem StemWijzer hervor. Das ist ein vom IPP entwickelter Test, mit dem Sie feststellen können, wie Sie persönlich zu den Zielen und Positionen von Parteien stehen. Dieser Test gehört in den Niederlanden seit langem fest zum Vorwahlgeschehen. Bei der Bundestagswahl 2002 wurde der Wahl-O-Mat über 3,6 Millionen mal gespielt. Seitdem wurde er von der bpb bei über zehn Landtagswahlen, sowie den Europawahlen 2004 und 2009 eingesetzt. Zur Europawahl 2009 wurde er mehr als 1,5 Millionen, zur Bundestagswahl 2009 über 6,7 Millionen Mal gespielt. Insgesamt hatte der Wahl-O-Mat seit 2002 bereits über 18 Millionen Nutzungen.<br/><br/>Die Redaktion des Wahl-O-Mat für die Landtagswahl 2010 in Nordrhein-Westfalen bestand aus insgesamt 20 jungen Menschen aus ganz Nordrhein Westfalen, unterstützt von Wissenschaftlern und Experten sowie der bpb, der Landeszentrale für politische Bildung Nordrhein-Westfalen und dem Landesjugendring Nordrhein-Westfalen. In drei Workshops hat die Redaktion die Thesen des Wahl-O-Mat entwickelt und formuliert. Den Parteien und sonstigen politischen Vereinigungen wurde eine Liste mit insgesamt 86 Thesen zugeschickt. Sie wurden gebeten, die Thesen entsprechend der Parteihaltung mit "stimme zu", "stimme nicht zu" oder "neutral" zu beantworten. Aus den ausgefüllten Listen wurden diejenigen Thesen rechnerisch ermittelt, die keine ausreichende Unterscheidung der Parteien und Wählervereinigungen möglich machten, und entfernt. Die Redaktion hat aus den verbleibenden eine endgültige Auswahl von 38 Thesen getroffen, die in den Wahl-O-Mat eingebunden wurden. Die Parteien und Wählervereinigungen waren an der Endauswahl der Thesen nicht beteiligt. Mehr zum Entstehungsprozess eines Wahl-O-Mat finden Sie in unserem <a tabindex="24" title="Making of (Dieser Link öffnet sich in einem neuen Fenster.)" target="_blank" class="link_normal" href="http://www.bpb.de/methodik/AN79O6">"Making of"</a>.';
WOMT_aTexte['popup_faq_3_frage']=new Array();
WOMT_aTexte['popup_faq_3_frage'][0]='Wieso kommen manche wichtige Themen im Wahl-O-Mat nicht zur Sprache?';
WOMT_aTexte['popup_faq_3_text']=new Array();
WOMT_aTexte['popup_faq_3_text'][0]='Das ist eine schwierige Frage. Wer entscheidet, welche Themen wichtig sind und welche nicht? Die Regierung, die Parteien, die Medien und die Bürgerinnen und Bürger haben dazu sehr unterschiedliche Meinungen. Bei der Auswahl der Thesen für unseren Wahl-O-Mat bezogen wir uns vor allem auf jene Themen, zu denen die Parteien und Wählervereinigungen unterschiedliche Meinungen haben und auf jene, die besonders auch für junge Leute von Interesse sind. Leider sind während des Entstehungsprozesses auch "gute" Thesen aus dem Wahl-O-Mat gefallen. Dies kam vor, weil Thesen von einzelnen Parteien nicht eindeutig mit stimme zu / stimme nicht zu / neutral beantwortet wurden oder weil die Parteipositionen in dieser These keine Unterscheidung zwischen den Parteien und Wählervereinigungen ermöglichten. Wir haben Interesse an Ihrer Meinung. Schicken Sie uns Ihre Überlegungen zu, am besten unter: <a tabindex="26" title="" class="link_normal" href="mailto:info@wahl-o-mat.de">info@wahl-o-mat.de</a>';
WOMT_aTexte['popup_faq_5_frage']=new Array();
WOMT_aTexte['popup_faq_5_frage'][0]='Was mache ich, wenn ich zu einem Thema nichts angeben möchte?';
WOMT_aTexte['popup_faq_5_text']=new Array();
WOMT_aTexte['popup_faq_5_text'][0]='Dann enthalten Sie sich Ihrer Stimme und klicken auf "These überspringen". Diese Aussage wird dann beim Ergebnis nicht berücksichtigt. Letzteres sollten Sie aber nicht zu oft machen, denn wenn zu oft "überspringen" geklickt wird, kann auch kein zuverlässiges Ergebnis errechnet werden. Sie haben jedoch auch die Möglichkeit, jederzeit wieder zu einer These zurückzukehren, um sie doch noch zu beantworten.';
WOMT_aTexte['popup_faq_6_frage']=new Array();
WOMT_aTexte['popup_faq_6_frage'][0]='Wie ist es möglich, dass ich als Ergebnis die Partei erhalte, die ich überhaupt nicht erwartet habe?';
WOMT_aTexte['popup_faq_6_text']=new Array();
WOMT_aTexte['popup_faq_6_text'][0]='Das wissen wir natürlich auch nicht. Bitte erwarten Sie von uns kein Urteil darüber, was eine "gute" oder eine "schlechte" Partei oder Wählervereinigung ist. In unserer Nutzerbefragung zum Wahl-O-Mat erfuhren wir, dass der Wahl-O-Mat bei etwa 10% der Nutzer ein überraschende Ergebnisse aufweist. Das von Ihnen ermittelte Wahl-O-Mat Ergebnis ist eben ein Durchschnittsergebnis aus vielen Themengebieten. Es kann also sein, dass Sie bei einem Themengebiet die Meinung der Partei oder Wählervereinigung, der Sie bisher am nahesten standen, treffen, aber im Wahl-O-Mat Gesamtergebnis noch besser mit einer anderen Partei oder Wählervereinigung übereinstimmen. Berücksichtigt werden muss außerdem, dass sich das Ergebnis des Wahl-O-Mat eben nur auf die bereitgestellte Thesenauswahl bezieht. Sicher gibt es auch weitere gute Gründe, sich der einen oder anderen Partei oder Wählervereinigung nahe zu fühlen. Wir finden, dass dies eine gute Gelegenheit ist, sich mit den eigenen politischen Positionen und denen der Parteien und Wählervereinigungen auseinander zu setzen. Schauen Sie doch einfach mal auf die Webseiten der Parteien.';
WOMT_aTexte['popup_faq_7_frage']=new Array();
WOMT_aTexte['popup_faq_7_frage'][0]='Warum kann es vorkommen, dass bei mir Übereinstimmungen mit einer vom Verfassungsschutz als extremistisch eingestuften Partei angezeigt werden?';
WOMT_aTexte['popup_faq_8_frage']=new Array();
WOMT_aTexte['popup_faq_8_frage'][0]='Ich möchte mehr erfahren als nur das Endergebnis. Wie kann ich die Einstellungen der verschiedenen Parteien zu einzelnen Thesen erfahren und vergleichen?';
WOMT_aTexte['popup_faq_8_text']=new Array();
WOMT_aTexte['popup_faq_8_text'][0]='Auf dem Ergebnisbildschirm sehen Sie direkt, wie jede der von Ihnen ausgewählten Parteien oder Wählervereinigungen zu jeder These gestimmt hat ("stimme zu"= grünes Häkchen, "stimme nicht zu"= rotes Kreuz, "neutral"= graues Minuszeichen). Ein Klick auf das entsprechende Symbol zeigt eine kurze Begründung der Partei bzw. Wählervereinigung für Ihre Position an, sofern eine Begründung abgeben wurde. Wenn Sie auf dem Ergebnisbildschirm das Logo einer Partei bzw. Wählervereinigung anklicken, können Sie auf der dann folgenden Seite Ihre eigenen Stellungnahmen zu jeder These mit denen der Partei bzw. Wählervereinigung im Detail vergleichen. Auch dort finden Sie unter dem Icon "P" (= Position der Partei) kurze Begründungen der Partei bzw. Wählervereinigung für deren Positionierung.';
