WOMT_aTexte['4_umfrage_text']=new Array();
WOMT_aTexte['4_umfrage_text'][0]='Wir würden aus wissenschaftlichen Gründen gerne mehr darüber erfahren, warum und mit welchen Folgen Sie den Wahl-O-Mat genutzt haben. Deswegen würden wir Sie bitten, an der folgenden anonymisierten Umfrage teilzunehmen. Sie wird rund fünf Minuten Ihrer Zeit in Anspruch nehmen. Schon einmal herzlichen Dank!';
