WOMT_aTexte['popup_faq_10_text']=new Array();
WOMT_aTexte['popup_faq_10_text'][0]='Hier handelt es sich um die Parteien, die bei der letzten Landtagswahl landesweit mindestens fünf Prozent der Zweitstimmen erhalten haben und somit in Fraktionsstärke im Landtag vertreten sind. Diese vier Parteien spielen im Wahlkampf und bei der Wahlentscheidung für viele eine besonders hervorgehobene Rolle. Sie haben in den letzten fünf Jahren an der politischen Willensbildung und Entscheidungsfindung erheblich mitwirken können. Und sie haben den Wahlprognosen zufolge eine gute Chance, wieder im Landtag von Nordrhein-Westfalen vertreten zu sein. Deswegen sind ihre Positionen zu den Themen der Landtagswahl in Nordrhein-Westfalen von besonderer Bedeutung.';
