WOMT_aTexte['4_erg_text_1'][0]='Hohe Übereinstimmungen Ihrer Antworten mit mehreren Parteien bedeutet nicht zwangsläufig eine inhaltliche Nähe der Parteien zueinander.<br/><br/>Die meisten der 38 Wahl-O-Mat-Thesen decken wichtige sachpolitische Themen zur Landtagswahl in Nordrhein-Westfalen 2010 ab. Auf diese haben auch Parteien geantwortet, die vom Verfassungsschutz als extremistisch eingestuft werden (<a class="pfeil_fett" href="http://www.im.nrw.de/sch/29.htm" tabindex="39" title="Verfassungsschutzbericht NRW 2009 (Dieser Link öffnet sich in einem neuen Fenster.)" target="_blank" style="padding-left:0px;background-image: none !important;">Verfassungsschutzbericht NRW 2009</a>). Zur besseren Einordnung der einzelnen Parteien lesen Sie bitte auch deren Begründungen zu den einzelnen Thesen und besuchen das Angebot <a tabindex="39" title="Wer steht zur Wahl? (Dieser Link öffnet sich in einem neuen Fenster.)" class="pfeil_fett" href="http://www.wahl-o-mat.de/nrw2010/wszw.php" target="_blank">www.werstehtzurwahl.de</a>.';
